function PastGames({ past }) {
    const games = [];

    console.log("past", past);
    Object.keys(past).forEach((key) => {
        games.push(
            [<div>
                <h2>{key}</h2>
                {past[key]}
            </div>]
        )
    })

    console.log("games", games);

    return (
        <div>
            {games.length === 0 ? <h3>No past games</h3> : {games}}
        </div>
    )
}

export default PastGames;
